    false,nt"url": null,nt"notes": "NODC Accession 0138037 includes physical
    and underway data collected aboard the MELVILLE during cruise MV1301 in the North
    Pacific Ocean and Philippine Sea from 2013-01-16 to 2013-01-29. These data include
    CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
    (V). The instruments used to collect these data include ADCP and GPS. These data
    were collected by Bruce Appelgate of University of California - San Diego; Scripps
    Institution of Oceanography and Kimberly Curl of Unknown as part of Transit. The
    Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part of
    the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
    not available in this accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
